import React from 'react';
import Grid from '@material-ui/core/Grid';
import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';
import GridListTileBar from '@material-ui/core/GridListTileBar';
import IconButton from '@material-ui/core/IconButton';
import StarIcon from '@material-ui/icons/StarBorder';
import { makeStyles } from '@material-ui/core/styles';
import Simeon from '../site-images/simeon.jpg';
import Jessica from '../site-images/jessica.jpg';
import Meghan from '../site-images/meghan.jpg';
import Marcoleno from '../site-images/marcoleno.jpg';
import Dat from '../site-images/dat.jpg';
import Abbey from '../site-images/abbey.jpg';

const useStyles = makeStyles((theme) => ({
    gridList: {
        margin: 'auto',
        maxWidth: 350,
        maxHeight: 350,
    },
    img: {
        maxWidth: 350,
    },
}));

const people = [
    {
        name: 'Simeon',
        by: 'Simeon Ikudabo',
        img: Simeon,
    },
    {
        name: 'Abbey',
        by: 'Abbey Fisher',
        img: Abbey,
    },
    {
        name: 'Marcoleno',
        by: 'Marcoleno Ball',
        img: Marcoleno,
    },
    {
        name: 'Jessica',
        by: 'Jessica Dub',
        img: Jessica,
    },
    {
        name: 'Dat',
        by: 'Dat Thomas',
        img: Dat,
    },
    {
        name: 'Meghan',
        by: 'Meghan Gulvas',
        img: Meghan,
    },
];

export default function GridListExample() {
    const classes = useStyles();

    return (
        <GridList
            cols={2}
            className={classes.gridList}
        >
            {people.map((p, index) => {
                return (
                    <GridListTile 
                        cols={1}
                        key={index}
                    >
                        <img 
                            alt={p.name} 
                            src={p.img} 
                            title={p.name}
                            
                        />
                        <GridListTileBar 
                            title={p.name} 
                            subtitle={p.by} 
                            actionIcon={
                                <IconButton 
                                    style={{
                                        color: 'rgb(255, 255, 255)',
                                    }}
                                >
                                    <StarIcon />
                                </IconButton>
                            }
                        />
                    </GridListTile>
                );
            })}
        </GridList>
    );
}
